// src/components/CarHighlights.js
import CarCard from './CarCard';

function CarHighlights() {
  const cars = [
    {
      id: 1,
      name: "Modelo 1",
      description: "Descrição breve do carro.",
      image: "https://via.placeholder.com/150" // substitua pela URL da imagem do carro
    },
    {
      id: 2,
      name: "Modelo 2",
      description: "Descrição breve do carro.",
      image: "https://via.placeholder.com/150"
    },
    {
      id: 3,
      name: "Modelo 3",
      description: "Descrição breve do carro.",
      image: "https://via.placeholder.com/150"
    },
  ];

  return (
    <section id="cars" className="py-16 bg-lightGray">
      <h3 className="text-3xl font-bold text-neutralBlack text-center mb-10">Destaques de Carros</h3>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8 max-w-5xl mx-auto px-4">
        {cars.map(car => (
          <CarCard
            key={car.id}
            image={car.image}
            name={car.name}
            description={car.description}
            onClick={() => alert(`Você clicou em ${car.name}`)}
          />
        ))}
      </div>
    </section>
  );
}

export default CarHighlights;
